import React from 'react';
import PopupWithForm from './PopupWithForm';

function DeleteCardPopup(props) {

  function handleSubmit(e) {
    e.preventDefault();

    props.onDeleteCard();
  }

  return (
    <PopupWithForm
      name="delete-card"
      isOpen={props.isOpen}
      onClose={props.onClose}
      title="Вы уверены ?"
      onSubmit={handleSubmit}
      buttonText="Да"
    >
    </PopupWithForm>
  );
}

export default DeleteCardPopup;
